import React, { useState } from 'react';
import { Container, Paper, TextField, Button, Typography, Box } from '@mui/material';

const EditStaff = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    position: '',
    department: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Edit staff:', formData);
  };

  return (
    <Container maxWidth="md">
      <Box sx={{ mt: 4 }}>
        <Paper elevation={3} sx={{ p: 4 }}>
          <Typography variant="h4" gutterBottom>
            Edit Staff Member
          </Typography>
          <form onSubmit={handleSubmit}>
            <TextField
              fullWidth
              margin="normal"
              name="firstName"
              label="First Name"
              value={formData.firstName}
              onChange={handleChange}
              required
            />
            <TextField
              fullWidth
              margin="normal"
              name="lastName"
              label="Last Name"
              value={formData.lastName}
              onChange={handleChange}
              required
            />
            <TextField
              fullWidth
              margin="normal"
              name="email"
              label="Email"
              type="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
            <TextField
              fullWidth
              margin="normal"
              name="position"
              label="Position"
              value={formData.position}
              onChange={handleChange}
              required
            />
            <TextField
              fullWidth
              margin="normal"
              name="department"
              label="Department"
              value={formData.department}
              onChange={handleChange}
              required
            />
            <Button
              type="submit"
              variant="contained"
              sx={{ mt: 3, mr: 2 }}
            >
              Update Staff
            </Button>
            <Button
              variant="outlined"
              sx={{ mt: 3 }}
            >
              Cancel
            </Button>
          </form>
        </Paper>
      </Box>
    </Container>
  );
};

export default EditStaff;
